window.bookSummaryJSON = "<p>Three audiobooks from best-selling author Steven Becker.</p> <p><i>Wood’s Harbor</i></p> <p>Washed up on a beach, with a path of destruction in his wake, Mac Travis must put his life back together. With his girlfriend in a coma and hanging by a thread, he becomes embroiled in a plan to blow up the US and Cuba’s fledgling relationship. Along with his wayward mate, the colorful Trufante, they fight to save Mel’s life and get back everything he’s lost. Experience the Florida Keys in this new adventure by best-selling author Steven Becker.</p> <p><i>Wood’s Reach</i></p> <p>Desperate for money and with Alicia in danger, Mac is forced to deal with a dubious antiquities dealer. The treasure hunt turns deadly as he tries to solve the riddle of the relic he found years ago.</p> <p><i>Wood’s Revenge</i></p> <p>Minding his own business is what Mac Travis does best until a strong storm coupled with a king tide brings dead fish to his doorstep. Mac investigates the cause, discovering a murder and wreck at a testing station in Florida Bay. The trail leads him deep into the backcountry of the Florida Keys, where he uncovers a plan that could lead to the destruction of the Everglades. Along with Mel and Trufante, he sets out to save the ecosystem but soon becomes embroiled in the politics and power of Big Sugar.</p> <p>The forces collide in this action-packed thriller bundle featuring plenty of boating, scuba diving and fishing and flavored with a generous dose of Conch Republic counterculture.</p>"; 
